import React from 'react';
import './styles/navbar.css'
import logo from '../assents-img/logo.svg'
import {Link} from 'react-router-dom'
import Media from 'react-media'




class Navbar extends React.Component {

    render() {
        return (
            <React.Fragment>
                <Media query={{maxWidth:838}}>
                <div className='nav'> {/*Mobile Menu*/}
                    <div className="menu-mobile">
                    <div onClick={menuA()} id='but' className="button"></div>
                    {
                        function menuA(){
                        document.getElementById('menu', function(){
                            if (this.classList.contains('menu-list')) {
                                this.classList.remove('menu-list');
                                this.classList.add('menu-list-active')
                            } else {
                                console.log('wat');

                            }
                        } )

                    }}
                    <ul id='menu' className='menu-list'> 
                        <h3>Menu</h3>
                        <hr/>
                        <li>Inicio</li>
                        <li>Sobre nosotros</li>
                        <li>Tratamientos</li>
                        <li>Instalaciones</li>
                        <li>Contacto</li>
                    </ul>
                    <div className="footer-menu">
                    <img src={logo} alt=""/>
                        <div className="contact-info-footer">
                        <p>Contactenos</p>
                        <hr/>
                        <br/>
                        <p>2323-2323 / 8736-8734</p>

                        </div>
                    </div>
                    </div>
                </div>


                </Media>
                <Media query={{minWidth:839}}>

                <div className='nav'> {/*Desktop Menu*/}
                    <div className="menu">
                    <ul> 
                    <img src={logo} alt=""/>
                        <a href="">Contacto</a> 
                        <a href="">Instalaciones</a> 
                        <a href="">Tratamientos</a>
                        <a href="">Sobre nosotros</a>
                        <a href="">Inicio</a>
                    </ul>
                    </div>
                </div>

                </Media>
            </React.Fragment>
        );
    }
}

export default Navbar;
